import sys


def bite(s: str, k: int, start_idx: int) -> int:
    consumed = set()
    for idx in range(start_idx, len(s)):
        if s[idx] in consumed:
            continue
        if len(consumed) == k:
            return idx
        consumed.add(s[idx])
    return len(s)


def count_partitions(s: str, k: int) -> int:
    idx = 0
    part = 0

    while idx < len(s):
        idx = bite(s, k, idx)
        part += 1

    return part


ALPHABET = [chr(x) for x in range(ord('a'), ord('z') + 1)]



def solve(s: str, k: int, can_replace: bool) -> int:
    if not s:
        return 0

    idx = bite(s, k, 0)

    # we can NEVER do better than this
    if idx == k or not can_replace:
        return 1 + solve(s[idx:], k, can_replace)

    # base case -- continue w/o replacement for this block
    best = 1 + solve(s[idx:], k, can_replace)

    # TODO: we can NOT actually use a replacement char that will invalidate
    #  previous group (meaning ANY char from the previous group);
    #  is this practically an issue though?
    # we can try to replace ANY char in this group to make it better
    for idx2 in range(0, idx):
        for replacement in ALPHABET:
            new_s = s[:idx2] + replacement + s[idx2 + 1:]
            cur = solve(new_s, k, can_replace=False)
            if cur > best:
                best = cur
    return best


class Solution:
    def maxPartitionsAfterOperations(self, s: str, k: int) -> int:
        return solve(s, k, can_replace=True)


if __name__ == '__main__':
    sys.setrecursionlimit(10**6)

